import React, { useState, useEffect } from "react";
import { Link, useParams } from "react-router-dom";
import SearchForm from "./SearchForm.js";
import Loading from "./"
import "./index.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSpinner, faCircleNotch } from '@fortawesome/free-solid-svg-icons';
import '@fortawesome/fontawesome-free/js/all';

const Results = (props) => {
  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const params = useParams();

  useEffect(() => {
    fetchData().catch( (error) => {
      console.log(error);
    })
  }, [params.query]);

  useEffect(() => {
    if (!isLoading){
      //remove the loading screen
    }
  }, [isLoading]);

  const fetchData = async () => {
    const results = await fetch("https://api.github.com/search/repositories?q=" + params.query);
    const data = await results.json();

    setData(data);
    setIsLoading(false);
  };

  function SearchResults(props) {
    if (props.totalCount !== undefined) {
      return (
        <div className="search-results">
          <h3 className="results-header">Search found {props.totalCount} results</h3>
          <ul className="results-list">
            {
              data.items.map( item => {
                return (
                  <li key={item.id}>
                    <div className="result-container">
                      <div className="repo-container">
                        <div className="results-label results-repo">
                          <b>Repository:</b>
                          <Link to={`${item.id}`} state={{item_details: item}}>{item.name}</Link>
                        </div> 
                        <div className="results-label results-owner">
                          <b>Owner:</b> 
                          {item.owner.login}
                        </div>
                        <div className="results-label results-descr">
                          <b>Description:</b>
                          {item.description}
                        </div>
                      </div>
                      <img src={item.owner.avatar_url} alt="repo owner avatar" className="avatar"/>
                    </div>
                  </li>
                );
              })
            }
          </ul>
        </div>
      );
    }

    return null;
  }

  return (
    <div>
      <SearchForm style_top="true" />
      {/* <Loading loading={isLoading} /> */}
      <div className="spinner">
        {/* <!-- [ldio] generated by https://loading.io/ --> */}
        <svg  style="margin: auto; background: rgb(241, 242, 243); display: block; shape-rendering: auto;" width="240px" height="240px" viewBox="0 0 100 100" preserveAspectRatio="xMidYMid">
          <g transform="rotate(0 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.9166666666666666s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(30 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.8333333333333334s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(60 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.75s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(90 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.6666666666666666s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(120 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.5833333333333334s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(150 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.5s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(180 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.4166666666666667s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(210 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.3333333333333333s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(240 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.25s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(270 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.16666666666666666s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(300 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="-0.08333333333333333s" repeatCount="indefinite"></animate>
            </rect>
          </g><g transform="rotate(330 50 50)">
            <rect x="47" y="25.5" rx="3" ry="4.03" width="6" height="13" fill="#93dbe9">
              <animate attributeName="opacity" values="1;0" keyTimes="0;1" dur="1s" begin="0s" repeatCount="indefinite"></animate>
            </rect>
          </g>
        </svg>
      </div>
      <SearchResults totalCount={data.total_count} query={params.query} />
    </div>
  )
}

export default Results;
